using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using ForumAppMVC.Data.Models;

namespace ForumAppMVC.Data.Seeding
{
	public class CategoriesSeeder : ISeeder
	{
		public async Task SeedAsync(ApplicationDbContext dbContext, IServiceProvider serviceProvider)
		{
			if (dbContext.Categories.Any())
			{
				return;
			}

			var categories = new List<(string Name, string ImageUrl)> 
			{ 
				("News", "data:image/jpeg;base64,"),
				("Sport", "data:image/jpeg;base64,"),
				("Music", "https://static.vecteezy.com/system/resources/previews/037/044/052/non_2x/ai-generated-studio-shot-of-black-headphones-over-music-note-explosion-background-with-empty-space-for-text-photo.jpg"),
				("Animals", "data:image/jpeg;base64,"),
				("World", "data:image/jpeg;base64,"),
			};

			foreach (var category in categories)
			{
				await dbContext.Categories.AddAsync(new Category
				{
					Name = category.Name,
					Description = category.Name,
					Title = category.Name,
					ImageUrl = category.ImageUrl
				});
			}
		}
	}
}
